    [],nt"revision_timestamp": "2016-07-27T23:02:17.863425",nt"name": "breeding-ground-survey-alaska-may-18-to-june-11-1965",nt"isopen":
    false,nt"url": null,nt"notes": "This report summarizes the results of a
    breeding ground survey in Alaska during the 1965 breeding season. This year 206
    of the 214, 16 mile transects laid out for breeding pair survey were completed in
    101 flying hours by 180 Cessna. The survey showed a 27% decrease in breeding duck
    pairs from 1964 and a 28% decrease from the 10 year average. Duck production was
    very poor in 1964 due to the latest spring break-up on record followed by extensive
    flooding of nesting habitat so the reduced breeding population of 1965 comes as
    no surprise. The habitat this year appears to be in good shape and nesting began
    on schedule. What little data we have thus far, mostly for geese and swan, indicates
    high nest densities and large clutches so we may have a good chance of recovering
    the 1964 losses or at least producing a fall flight comparable to 1964.",nt"license_title":
